    <style>
        /* Your existing CSS styles */
        body {
            font-family: "Montserrat", sans-serif;
            background-color: #0D0D0D; /* Dark background */
            color: #F0F0F0; /* Light text color */
            min-height: 100vh;
            padding-bottom: 50px;
        }
        .tv_catalog {
            margin-top: 20px;
            background-color: #0D0D0D; /* Darker background for the catalog */
            padding: 20px; /* Add some padding */
            border-radius: 10px; /* Rounded corners */
            color: #FFFFFF; /* Ensure text color is white */
        }
        .tvimage {
            border-radius: 20px;
            transition: transform 0.3s ease;
            height: 150px; /* Set a fixed height for images */
            object-fit: cover; /* Ensures the image covers the area */
        }
        .card {
            background-color: #2a2a2a; /* Darker card background */
            border: none; /* Remove card border */
            border-radius: 10px; /* Rounded corners for the card */
            transition: transform 0.3s ease; /* Card hover effect */
            color: #FFFFFF; /* Ensure text color in the card is white */
        }
        .card:hover {
            transform: translateY(-5px); /* Slight lift effect on hover */
        }
        footer {
            text-align: center;
            margin-top: 30px;
            color: #FFFFFF; /* Ensure footer text is white */
        }
        .form-control {
            background-color: #333; /* Dark input background */
            color: #FFFFFF; /* Light text color */
            border: 1px solid #444; /* Dark border */
        }
        .form-control::placeholder {
            color: #AAAAAA; /* Light gray for placeholder text */
        }
        .btn-danger {
            background-color: #C0392B; /* Red button color */
            border-color: #A93226; /* Darker red border */
            color: #FFFFFF; /* Ensure button text is white */
        }
        .btn-danger:hover {
            background-color: #A93226; /* Darker red on hover */
        }
    </style>
